sys_variable_value.value:
(function execute(inputs, outputs) {
    var gcc = new GoogleCloudComputeUtils();
    gcc.validateInputVariables(inputs, outputs);
    gcc.validateMandatoryVariables(inputs, ['projectid', 'zone', 'instance', 'disk']);
    gcc.maptoOutputFromInput(inputs, outputs, ['projectid', 'zone', 'instance']);
    outputs.requestbody = JSON.stringify({
        "deviceName": inputs.disk,
        "autoDelete": inputs.autodelete,
        "boot": inputs.boot,
        "source": "projects/" + inputs.projectid + "/zones/" + inputs.zone + "/disks/" + inputs.disk
    });
})(inputs, outputs);

